import React from 'react';
import './ImageList.css';

const ImageList = (props) => {

    const images = props.images.map(({description, id, urls}) => {
        return <img alt={description} key={id} src={urls.regular}></img>
    });

    return (
        <div>{images}</div>
    );
};

export default ImageList;
